import { useState } from "react";

function NewExpense(props) {
  return (
    <div className="max-w-xl mx-auto  bg-sky-800 p-5 m-4 rounded-lg text-sky-50 font-bold align-middle">
      <form className="flex gap-5 w-full flex-wrap" >
        <div className="flex">
          <label className="w-16">date</label>
          <input type="date" className="rounded-md bg-sky-50 text-sky-900 px-2 py-1 w-30"  />
        </div>
        <div className="flex">
          <label className="w-16">name</label>
          <input type="text" className="rounded-md bg-sky-50 text-sky-900 px-2 py-1 w-30 " />
        </div>
        <div className="flex">
          <label className="w-16">price</label>
          <input type="number" min={0.1}  className="rounded-md bg-sky-50 text-sky-900 py-1  px-2 "  />
        </div>
        <button type="submit" className="bg-sky-500 py-1 px-4 rounded-md">Confirm</button>
      </form>
    </div>
  );
}

export default NewExpense;
